  [],\n\t\"revision_timestamp\": \"2016-10-08T15:55:46.576077\",\n\t\"name\": \"2012-fish-springs-nwr-predator-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Report on a 2012 study to determine a relative
  index of predator populations, primarily coyote, on fish Springs National Wildlife
  refuge.  Scat deposition transects and remote camera traps were used to index predator
  populations.  Based on the results found from predator surveys, coyotes have the
  highest population of all predators on the refuge. Common ravens were also present
  during the nesting season.  The data collected this year provides a baseline for
  predator population monitoring.  These trends can also be analyzed to determine
  how predator activity on the refuge changes over time.\",\n\t\"license_title\":
